import React, { Component } from 'react';


class Testdad extends Component {
    render() {
        return (
            <div className="Testdad">
                <p>asdadasd</p>
                <p> hi</p>
                <p>i'm</p>
                <p>Tom</p>
                
            </div>
        )

    }
}


export default Testdad;
